import React, { useEffect, useState } from 'react';
import axios from 'axios';
import { BarChart, Bar, XAxis, YAxis, CartesianGrid, Tooltip as RechartsTooltip, ResponsiveContainer, PieChart, Pie, Cell } from 'recharts';
import { format } from 'date-fns';
import { Line } from 'react-chartjs-2';
import {
  Chart as ChartJS,
  CategoryScale,
  LinearScale,
  PointElement,
  LineElement,
  Title,
  Tooltip,
  Legend
} from 'chart.js';

// Register ChartJS components
ChartJS.register(
  CategoryScale,
  LinearScale,
  PointElement,
  LineElement,
  Title,
  Tooltip,
  Legend
);

const COLORS = ['#0088FE', '#00C49F', '#FFBB28', '#FF8042', '#8884D8', '#82CA9D', '#FFC658', '#FF7C43', '#A4DE6C', '#D0ED57'];

function VibeStats() {
  const [stats, setStats] = useState({
    totalVibes: 0,
    averageMood: 0,
    moodTrend: []
  });

  useEffect(() => {
    const fetchStats = async () => {
      try {
        const response = await axios.get('http://localhost:3002/api/vibes/stats');
        setStats(response.data);
      } catch (err) {
        console.error('Failed to fetch stats:', err);
      }
    };

    fetchStats();
  }, []);

  const chartData = {
    labels: stats.moodTrend.map((_, index) => `Day ${index + 1}`),
    datasets: [
      {
        label: 'Mood Trend',
        data: stats.moodTrend,
        fill: false,
        borderColor: 'rgb(75, 192, 192)',
        tension: 0.1
      }
    ]
  };

  // Prepare data for the bar chart (daily vibes)
  const dailyData = Object.entries(stats.dailyVibes).map(([date, vibes]) => ({
    date: format(new Date(date), 'MMM d'),
    count: vibes.length
  }));

  // Prepare data for the pie chart (emoji distribution)
  const emojiData = Object.entries(stats.emojiCount).map(([emoji, count]) => ({
    name: emoji,
    value: count
  }));

  return (
    <div className="vibe-stats">
      <h2>Your Vibe Statistics</h2>
      <div className="stats-summary">
        <div className="stat-item">
          <h3>Total Vibes</h3>
          <p>{stats.totalVibes}</p>
        </div>
        <div className="stat-item">
          <h3>Average Mood</h3>
          <p>{stats.averageMood.toFixed(1)}</p>
        </div>
      </div>
      <div className="chart-container">
        <Line data={chartData} />
      </div>
      <div className="chart-container">
        <h3>Daily Vibes</h3>
        <ResponsiveContainer width="100%" height={300}>
          <BarChart data={dailyData}>
            <CartesianGrid strokeDasharray="3 3" />
            <XAxis dataKey="date" />
            <YAxis />
            <RechartsTooltip />
            <Bar dataKey="count" fill="#8884d8" />
          </BarChart>
        </ResponsiveContainer>
      </div>

      <div className="chart-container">
        <h3>Emoji Distribution</h3>
        <ResponsiveContainer width="100%" height={300}>
          <PieChart>
            <Pie
              data={emojiData}
              dataKey="value"
              nameKey="name"
              cx="50%"
              cy="50%"
              outerRadius={100}
              label
            >
              {emojiData.map((entry, index) => (
                <Cell key={`cell-${index}`} fill={COLORS[index % COLORS.length]} />
              ))}
            </Pie>
            <RechartsTooltip />
          </PieChart>
        </ResponsiveContainer>
      </div>
    </div>
  );
}

export default VibeStats;
